import React, { Component } from "react";
import "./mapbox.css";

class Flag extends Component {
  render() {
    return (
      <div>
        <img
          className="marker"
          style={{
            height: `${6 * viewport.zoom}px`,
            width: `${6 * viewport.zoom}px`,
          }}
          src="https://i.imgur.com/y0G5YTX.png"
          alt="marker"
        />
      </div>
    );
  }
}

export default Flag;
